import React from 'react'
import NavbarRadnik from '../NavbarRadnik'
import Profile from '../Profile'
import './RadnikMojProfil.css'
import jane from '../../images/jane-doe.jpg';

export default class RadnikMojProfil extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      photo: jane,
      profileFields: {
        firstName: "Niko",
        lastName: "Nikić",
        jobTitle: 'Recepcioner',
        birthday: '1.1.1980.',
        jmbg: '0101980111111'
      }
    }
  }

  render () {
    return (
      <div className="profile-page">
        <NavbarRadnik/>
        <Profile polja={this.state.profileFields} photo={this.state.photo} />
      </div>
    )
  }
}
